Scott Kelbys Digital Photography Boxed Set, Volumes 1, 2, and 3 

Scott Kelby, the man who changed the digital darkroom forever with his groundbreaking, number 1 bestselling, award-winning book The Photoshop Book for Digital Photographers, shows which button to push, which setting to use, when to use them, and hundreds of the most closely guarded photographic tricks of the trade to get budding photographers shooting dramatically better-looking, sharper, more colorful, more professional-looking photos with their digital camera every time they press the shutter button.

Scott tackles the most important side of digital photography--how to take pro-quality shots using the same tricks today's top digital pros use (and it's easier than you'd think). Each chapter is packed with plain English tips on using flash, shooting close up photography, travel photography, shooting people, and even how to build a studio from scratch, where he demystifies the process so anyone can start taking pro-quality portraits today! Plus, hes got full chapters on his most requested topics, including loads of tips for landscape photographers, wedding photographers, and theres an entire chapter devoted to sharing some of the pros secrets for making your photos look more professional, no matter what youre shooting.

